import React from 'react'


class Social extends React.Component {

    render() {

        return (
            <div className="social">

                <a href="https://www.reddit.com/submit?url=https://shitstorm.app&title=Shitstorm:%20a%20rude%20weather%20app" target="_blank">

                    <img src={require('../img/reddit.svg')} alt="Post to Reddit"/>

                </a>
                <a href="https://www.facebook.com/sharer/sharer.php?u=https%3A//shitstorm.app">
                    <img src={require('../img/facebook.svg')} alt="Post to Facebook"/>
                </a>

                <a href="https://twitter.com/home?status=Shitstorm%20is%20a%20rude%20weather%20app%20that%20lets%20you%20know%20what%20the%20fuck%20is%20going%20on%20out%20there%20-%20https%3A//shitstorm.app">
                    <img src={require('../img/twitter.svg')} alt="Post to Twitter"/>
                </a>

            </div>
        )
    }
}


export default Social
